// ==UserScript==
// @name         オービス Button
// @namespace    http://tampermonkey.net/
// @version      1.2
// @description  WazeエディターからOrbis Guideページへリダイレクトするボタンを追加します。
// @author       Aoi
// @match        https://www.waze.com/*/editor?env=row*
// @grant        none
// @license      MIT
// @icon         data:image/jpeg;base64,
// @downloadURL https://update.greasyfork.org/scripts/540041/%E3%82%AA%E3%83%BC%E3%83%93%E3%82%B9%20Button.user.js
// @updateURL https://update.greasyfork.org/scripts/540041/%E3%82%AA%E3%83%BC%E3%83%93%E3%82%B9%20Button.meta.js
// ==/UserScript==

(function () {
    'use strict';

    /**
     * ボタンを作成し、ドラッグ移動可能にする関数
     * @param {string} iconUrl - ボタンのアイコンURL
     * @param {string} clickUrl - ボタンクリック時に開くURL
     * @param {string} storageKey - ボタン位置を保存するlocalStorageのキー
     * @param {object} defaultPosition - ボタンのデフォルト位置
     */
    function createDraggableButton(iconUrl, clickUrl, storageKey, defaultPosition) {
        // LocalStorageから位置情報を取得
        const storedPosition = JSON.parse(localStorage.getItem(storageKey)) || defaultPosition;

        // ボタン要素を作成
        const button = document.createElement('button');
        const icon = document.createElement('img');
        icon.src = iconUrl;
        icon.alt = 'Button Icon';
        icon.style.width = '24px';
        icon.style.height = '24px';
        icon.style.verticalAlign = 'middle';

        // ボタンのスタイル設定
        Object.assign(button.style, {
            position: 'fixed',
            top: storedPosition.top || defaultPosition.top,
            right: storedPosition.right || defaultPosition.right,
            left: storedPosition.left || 'auto',
            zIndex: '1000',
            padding: '10px',
            backgroundColor: 'transparent',
            border: 'none',
            borderRadius: '5px',
            cursor: 'pointer',
        });

        button.appendChild(icon);

        // クリックイベントの設定
        button.addEventListener('click', () => {
            window.open(clickUrl, '_blank');
        });

        // ドラッグ移動の設定
        button.addEventListener('mousedown', (event) => {
            event.preventDefault();
            const shiftX = event.clientX - button.getBoundingClientRect().left;
            const shiftY = event.clientY - button.getBoundingClientRect().top;

            const onMouseMove = (event) => {
                button.style.right = 'auto';
                button.style.left = `${event.pageX - shiftX}px`;
                button.style.top = `${event.pageY - shiftY}px`;
            };

            const onMouseUp = () => {
                // 位置をlocalStorageに保存
                localStorage.setItem(storageKey, JSON.stringify({
                    top: button.style.top,
                    right: button.style.right,
                    left: button.style.left,
                }));
                document.removeEventListener('mousemove', onMouseMove);
                document.removeEventListener('mouseup', onMouseUp);
            };

            document.addEventListener('mousemove', onMouseMove);
            document.addEventListener('mouseup', onMouseUp);
        });

        button.ondragstart = () => false;

        // ボタンをページに追加
        document.body.appendChild(button);
    }

    // Orbis Guideボタンを作成
    createDraggableButton(
        'data:image/jpeg;base64,',
        'https://orbis-guide.com/',
        'wazeOrbisButtonPosition',
        { top: '490px', right: '12px' }
    );
})();